__NUXT_JSONP__("/6_rrvz50in36", (function(a){return {data:[{id:"6_rrvz50in36",createdAt:a,updatedAt:a,publishedAt:a,revisedAt:a,title:"お知らせ",body:"\u003Cp\u003Eこんばんは！ @gamma_410 です。\u003Cbr\u003E今回の記事では ちょっとしたお知らせ を書きたいと思います。\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"he3aa402375\"\u003Eお知らせ\u003C\u002Fh2\u003E\u003Cp\u003E4月8日 から受験勉強に集中したいため浮上しないことにします。\u003Cbr\u003E(正確に言うと、できる限り浮上しないように努力するってことです......)\u003Cbr\u003E\u003Cbr\u003E理由は上記で述べた通り受験生なので、これ以上ネットに依存してしまうとリアル(現実の生活)に影響が出てしまうかなと思ったからです。\u003Cbr\u003E何か連絡がある場合は 下記に連絡してください。\u003C\u002Fp\u003E\u003Cul\u003E\u003Cli\u003ETwitter: @gamma_410 の DM \u003C\u002Fli\u003E\u003Cli\u003EDiscord: gamma#2105 の DM\u003C\u002Fli\u003E\u003Cli\u003Eメール: mail@dr-notes.work\u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Ch2 id=\"ha30c14b9ae\"\u003Eちょっとしたお願い。\u003C\u002Fh2\u003E\u003Cp\u003E本当にどうでもいいことかもしれませんが、、、僕が居なくなっても嫌いにならないでほしいです......\u003Cbr\u003E僕がフォローする時は必ず「仲良くしたい」、「お友達になりたい」、「尊敬してる」という気持ちがある時です。\u003Cbr\u003Eなので、受験が終わって戻ってきたときも絡んでほしいです。(ワガママに聞こえたらごめんなさい🙇‍♂️)\u003Cbr\u003E\u003Cbr\u003E以上です。\u003Cbr\u003Eこれからもずっとよろしくね。\u003Cbr\u003E\u003Cbr\u003Eおわり。\u003Cbr\u003E\u003Cbr\u003E\u003C\u002Fp\u003E"}],fetch:{},mutations:void 0}}("2022-04-04T15:33:15.202Z")));